            <input type="text" id="email"/>
            </div>

            <div className="pass-id">
            <label htmlFor="password">Enter Password</label>
            <input type="password" id = "password"/>
            </div>

            <div className="log-btn">
            <button type="submit">Log In</button>
            </div>

        </form>

    );
};

export default Form;
